import React from "react";

const Buttons = ({
    handleP1Increment,
    handleP2Increment,
    handleReset,
}) => (
        <>
            <button
                className="btn btn-danger"
                onClick={handleReset}>Reset</button>

            <button
                className="form-control btn btn-success"
                onClick={handleP1Increment}>+</button>

            <button
                className="form-control btn btn-success"
                onClick={handleP2Increment}>+</button>
        </>
    );

export default Buttons;
